import React, { useEffect, useState } from 'react';
import { db, storage, auth } from '../firebase';
import { collection, query, where, getDocs } from 'firebase/firestore';
import { ref, getDownloadURL } from 'firebase/storage';
import { onAuthStateChanged } from 'firebase/auth';
import './styles.css'; // Assume you have a CSS file for styles

const All = ({ selectedUniversity }) => {
  const [posts, setPosts] = useState([]);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [user, setUser] = useState(null);

  useEffect(() => {
    const unsubscribe = onAuthStateChanged(auth, (currentUser) => {
      setUser(currentUser);
      if (currentUser) {
        console.log('User authenticated:', currentUser.uid);
      } else {
        console.log('No user authenticated');
      }
    });

    return () => unsubscribe();
  }, []);

  // All コンポーネントまたは Culture コンポーネント内の useEffect 内での Firestore データの取得部分に console.log を追加します
useEffect(() => {
  const fetchPosts = async () => {
    try {
      const q = query(
        collection(db, 'Post'),
        where('college', '==', selectedUniversity), // クエリ条件が正しいか確認します
        where('Field.field', 'in', ['体育系', '研究系', '文化系']) // クエリ条件が正しいか確認します
      );
      const querySnapshot = await getDocs(q);
      const fetchedPosts = [];

      console.log('Number of posts fetched:', querySnapshot.docs.length); // 取得したドキュメント数をログに出力します

      await Promise.all(
        querySnapshot.docs.map(async (doc) => {
          const postData = doc.data();
          console.log('Post data:', postData); // 取得したドキュメントのデータをログに出力します

          // ここで postData の構造を確認し、必要なデータが正しく取得されているかどうかを確認します
          // 必要に応じて postData の中身をログに出力して確認します

          const imageRef = ref(storage, `images/${postData.userID}/${postData.Field.Content.imageRandomId}`);
          const imageUrl = await getDownloadURL(imageRef);
          postData.imageUrl = imageUrl;
          fetchedPosts.push({ id: doc.id, ...postData });
        })
      );

      setPosts(fetchedPosts);
    } catch (error) {
      console.error('Error fetching posts:', error.message);
    }
  };

  if (selectedUniversity) {
    fetchPosts();
  }
}, [selectedUniversity]);


  const nextPosts = () => {
    if (currentIndex + 4 < posts.length) {
      setCurrentIndex(currentIndex + 4);
    }
  };

  const prevPosts = () => {
    if (currentIndex - 4 >= 0) {
      setCurrentIndex(currentIndex - 4);
    }
  };

  return (
    <div className="container">
      <div className="row">
        {posts.slice(currentIndex, currentIndex + 2).map((post) => (
          <div key={post.id} className="postContainer">
            <div className="postContent">
              {post.imageUrl && <img src={post.imageUrl} className="image" alt="Post" />}
              <div className="textContainer">
                <p>ユーザー名: {post.username}</p>
                <p>投稿内容: {post.Field && post.Field.Content && post.Field.Content.contents}</p>
<p>活動場所: {post.Field && post.Field.Content && post.Field.Content.actplace}</p>

              </div>
            </div>
          </div>
        ))}
      </div>
      <div className="row">
        {posts.slice(currentIndex + 2, currentIndex + 4).map((post) => (
          <div key={post.id} className="postContainer">
            <div className="postContent">
              {post.imageUrl && <img src={post.imageUrl} className="image" alt="Post" />}
              <div className="textContainer">
                <p>ユーザー名: {post.username}</p>
                <p>投稿内容: {post.Field.Content.contents}</p>
                <p>活動場所: {post.Field.Content.actplace}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
      <div className="buttonContainer">
        <button onClick={prevPosts} className="button">前へ</button>
        <button onClick={nextPosts} className="button">次へ</button>
      </div>
    </div>
  );
};

export default All;
